import { USER_ACTIVITY } from '../data/mocked-data'

export class Modelisation {
  constructor(data) {
    this.data = data
  }

  formatDataActivity() {
    return {
      sessions: this.data[0].sessions,
    }
  }
}
console.log(USER_ACTIVITY)
const dataApi = USER_ACTIVITY
console.log(dataApi)
const maClasse = new Modelisation(dataApi)
console.log(maClasse)
const maClasseActualisee = maClasse.formatDataActivity()
console.log(maClasseActualisee)
